import React, {useState} from "react";

interface Props {
    giveName:(name:string)=>void;
}

export const Form = (props:Props) => {

    const [city,setCity] = useState<string>();

    return <form action="">
            <label htmlFor="">
                Type city name
                <br/>
                <input
                    type="text"
                    onChange={e=>setCity(e.target.value)}
                    value={city}
                />
                <button type="submit">Confirm</button>
            </label>
        </form>

}
